// Практичні завдання

function delay(ms) {
  return new Promise((resolve) => {
    setTimeout(() => {
      resolve();
    }, ms);
  });
}

delay(3000).then(() => alert("виконалось через 3 секунди"));

delay(5000).then(() => console.log("done after 5s"));

//2
function delaySecond() {
  return new Promise((resolve) => {
    setTimeout(() => {
      resolve("Проміс виконано");
    }, 2000);
  });
}
delaySecond().then((data) => console.log(data));

//3
const checkEvenNumber = (arr) => {
  return new Promise((resolve, reject) => {
    const isEven = arr.every((number) => number % 2 === 0);

    if (isEven) {
      resolve(arr);
    } else {
      reject("Є непарні");
    }
  });
};

checkEvenNumber([2, 4, 8, 8, 4])
  .then((data) => console.log(`Серед чисел ${data} усі парні`))
  .catch((error) => console.log(error));

//4

const loadImg = (url) => {
  return new Promise((resolve, reject) => {
    const img = new Image();

    img.onload = () => resolve(img);
    img.onerror = () => reject("Не вдалося завантажити фото");

    img.src = url;
  });
};

loadImg(
  "data:image/jpeg;base64,"
)
  .then((img) => {
    document.body.appendChild(img);
  })
  .catch((error) => console.error(error));

//5

const sortNames = (people) => {
  return new Promise((resolve, reject) => {
    if (!Array.isArray(people)) {
      reject("помилка, переданий параметр не є масивом");
      return;
    }

    const names = people.map((person) => person.name).sort();
    resolve(names);
  });
};

const people = [
  { name: "John", age: 25 },
  { name: "Anna", age: 30 },
  { name: "Peter", age: 40 },
  { name: "Mary", age: 35 },
];
sortNames(people)
  .then((names) => console.log(names))
  .catch((error) => console.log(error));

//6

const numbers = (num1, num2) => {
  return new Promise((resolve, reject) => {
    if (typeof num1 === "number" && typeof num2 === "number") {
      resolve(num1 + num2);
    } else {
      reject("неправильні аргументи");
    }
  });
};

numbers(2, "4")
  .then((num) => console.log(num))
  .catch((error) => console.log(error));
